1. Si se utiliza de manera dependiente de proyecto utilizando el SDK, compruebe depende SDK libs proyecto directorio SecurityGuard ***. / X86 frasco hacia abajo y armeabi SecurityGuard / armeabi-v7a ***. Así que si hay, y el tamaño de la versión normal es lo mismo, si se trata de una copia del SDK para desarrollar aplicaciones de corriente, comprobar las aplicaciones actuales como archivo generado apk existir no existe, compruebe la configuración del IDE, como en el proyecto build.gradle jniLibs.srcDirs Android Studio.
 2. Debido a la limitación de cargar diferentes bibliotecas nativas de arquitectura (por lo tanto, archivos) en el sistema de versión de Android, asegúrese de que los archivos de la biblioteca nativa necesarios para la ejecución del proyecto existan en el directorio actual de la arquitectura de la CPU del teléfono móvil. Por ejemplo, el módulo de seguridad está temporalmente no disponible biblioteca nativa arquitectura arm64, si la corriente de apk de otros componentes dependientes contienen arm64 biblioteca nativa causará solución de carga de error es eliminar los componentes de dependencia relacionados con las bibliotecas nativas, asegurar que el apk final no existe arm64 -v8a.
 Desde el punto de compatibilidad arquitectura Android de vista, la eliminación de biblioteca nativa arquitectura arm64 no afecta a la aplicación que se ejecuta en el terminal correspondiente, la descripción específica se puede utilizar la palabra clave [Android tan compatibles] para buscar Buscar en el sitio
 La configuración de referencia de Android Studio tiene como objetivo garantizar que la apk final contenga solo los archivos de la arquitectura de CPU especificada:
